import React from 'react';

const Tags = ( { articleName, tags, setArticleInfo }) => {
  return (
    <div id="tags-section">
    {tags.content.map((tag, key) => (
        <p key={key}>{tag}</p>
    ))}
    </div>
  );
};

export default Tags;
